    let vara=vat.target.value;
    // console.log(vara)



    setData(vara)
    // console.log(vara)
  }

  return (
    <div>
      <input type="text" onChange={getdata} ></input>
      <input type="number" ></input>

      {/* <input type="text" onChange={getdata()}> </input> */}
      <h4> {Data} </h4>

    </div>
  )
}

export default App
